import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import MainScreen from './screens/Mainscreen'
import AnimationScreen from './screens/Animationscreen'

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} options={{ title: 'Home' }}/>
        <Stack.Screen name="Profile" component={ProfileScreen} />
        <Stack.Screen name="Main" component={MainScreen} />
        <Stack.Screen name="Animation" component={AnimationScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}



const HomeScreen = ({ navigation }) => {
  return (
    <View>
        <View>
            <Button title="Go to Profile" onPress={() => navigation.navigate('Profile', { name: 'Jane' })}/>
            <Text> This is Example </Text>
        </View>
        <View>
            <Button title="Go to Main" onPress={() => navigation.navigate('Main', { name: 'Jane' })}/>
            <Text> This is where you could use Machine Learning  to test photo performance!</Text>
        </View>
        <View>
            <Button title="Go to Animation" onPress={() => navigation.navigate('Animation', { name: 'Jane' })}/>
            <Text> This is where you could use Test our Animation Screen!</Text>
        </View>


    </View>
  );
};
const ProfileScreen = ({ navigation, route }) => {
  return <Text>This is {route.params.name}'s profile</Text>;
};




const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
